import React from "react";
import HeaderLayouts from "../layouts/HeaderLayouts";
import Product from "../components/ProductList";

const ProductPage: React.FC = () => {
  return (
    <div>
      <h1>Product</h1>
      <HeaderLayouts />
      <Product />
    </div>
  );
};

export default ProductPage;
